import { Button, Menu } from "antd";
import React from "react";

const Header = () => {
  return (
    <header style={{ width: "100%", display: "flex", 
      background: 'rgb(119, 172, 241)'
    }}>
      <Menu
        mode="horizontal"
        className="header-menu"
        style={{
          color:'white',
          background: 'rgb(119, 172, 241)',
          width: "100%",
          height: "50px",
          display: "flex",
          justifyContent: "center",
          fontSize: "18px",
          fontWeight: "inherit",
        }}
      >
        <Menu.Item key="home">
          <a href="#home">Home</a>
        </Menu.Item>
        <Menu.Item key="courses">
          <a href="#courses">Courses</a>
        </Menu.Item>
        <Menu.Item key="testimonials">
          <a href="#testimonials">Testimonials</a>
        </Menu.Item>
        <Menu.Item key="about">
          <a href="#about">About</a>
        </Menu.Item>
      </Menu>
      <span style={{ float: "right", paddingTop: "0.7%", paddingRight: "1%" }}>
        <Button size="small" type="primary">
          Login
        </Button>
      </span>
    </header>
  );
};

export default Header;
